import './home.css'
import React from 'react'

export default function Home() {
    return (
        <div className='home'>
            <img src=''
            alt='logo'
            />
            <img class="logo__pic" src="img/logo(white).svg" alt="mafa-logo-white"></img>
        </div>
    )
}
